@app.get("/auth/login")
def login_a(email,password):
    return_value = verifica_accesso(email,password)
    if return_value == 'non_autenticato':
        return JSONResponse(status_code=404, content={"error": f"Utente non registrato o credenziali errate"})
    if return_value == 'autenticato':
        return JSONResponse(status_code=200, content={'message':'Utente autenticato'})
    else:
        return JSONResponse(status_code=400, content={'error':'Errore imprevisto'})


