@app.post("/utenti")
def post_utente(item: Utenti_insert):
    return_value = inserimento_utente(item)
    if return_value is None or return_value == "errore":
        return JSONResponse(status_code=500, content={"error": "Il server non √® raggiungibile"})
    if return_value == "nessun_valore_inserito":
        return JSONResponse(status_code=400, content={"error": "Compilare tutti i campi"})
    if return_value == "v_base":
        return JSONResponse(status_code=400, content={"error": "Hai lasciato qualche campo con il valore di base"})
    if return_value == "cf_non_inserito":
        return JSONResponse(status_code=400, content={"error": "Nessun CF inserito"})
    if return_value == "utente_presente":
        return JSONResponse(status_code=409, content={"error": f"L'utente che stai cercando di inserire √® gia presente"})
    if return_value == "utente_riattivato":
        return JSONResponse(status_code=200, content={"message": f"L'utente √® stato riattivato"})
    else:
        return JSONResponse(status_code=200, content={"message": f"dati inseriti correttamente, risorsa con id: {return_value}"})
    
@app.post("/sala")
def post_sala(item:SaleUpdateClass):
    res = inserimento_sala(item)
    if res == "errore_query":
        return JSONResponse(status_code=500, content={"error": "Il server non √® raggiungibile"})
    if res == "nome_m":
        return JSONResponse(status_code=400, content={"error": "Nome sala mancante"})
    if res == "v_mancanti":
        return JSONResponse(status_code=400, content={"error": "Alcuni valori non sono stati inseriti"})
    if res == "v_base":
        return JSONResponse(status_code=400, content={"error": "Hai lasciato i valori di base es.'string'"})
    if res == "sala_esistente":
        return JSONResponse(status_code=409, content={"error": "La sala che stai tentando di inserire esiste gi√†!"})
    else:
        return JSONResponse(status_code=200, content={"message": "Sala inserita con successo"})
    
