@app.post("/prenotazione")
def post_prenotazione(item: PrenotazioniInsert):
    return_value = inserimento_prenotazione(item)
    if return_value == "errore_query":
        return JSONResponse(status_code=500, content={"error": "Siamo spiacenti ma c'√® stato un errore nel server"})
    if return_value == "min_p":
        return JSONResponse(status_code=400, content={"error": "Numero di partecipanti non valido"})
    if return_value == "errore_presenza":
        return JSONResponse(status_code=401, content={"error": "L'untente che sta cercando di eseguire la prenotazione non √® esistente o non √® attivo"})
    if return_value == "nessun_risultato_trovato":
        return JSONResponse(status_code=409, content={"error": "Impossibile eseguire la prenotazioine per la sala con i parametri da te inseriti, non e stata trovata nessuna sala con una corrispondenza migliore, per favore prova data/fascia oraria"})
    if return_value == "campi non inseriti":
        return JSONResponse(status_code=422, content={"error": "Attenzione! Uno o piu campi sono stati lasciati vuoti, correggi e riprova!"})
    if return_value == "ins_non_valido":
        return JSONResponse(status_code=400, content={"error": "Uno o pi√π campi inseriti non risultano validi, per favore correggi e riprova"})
    if return_value[0] == "sala_occupata":
        return Response(status_code=401,  content=(f"La sala che stai cercando di prenotare non corrisponde ai parametri da te inseriti ti consigliamo questa sala: {return_value[1]}"))
    if return_value == "prenotato_con_successo":
        return JSONResponse(status_code=200, content={"message": "Prenotazione registrata con successo!"})
        

